{'channel': {'title': 'Galãs Feios', 'description': 'Humor e opinião sobre política e cultura pop em geral pelos amigos Helder Maldonado e Marco Bezzi, que destilam seu ódio festivo pra falar também de música, cinema, TV e celebridades. A dupla que mais denuncia os golpes apresenta Lives e vídeos diários. 

