{'channel': {'title': 'Tese Onze', 'description': 'O Tese Onze é um canal focado em apresentar contrapontos ao senso comum, trazer análises sobre sociologia e política, e acumular bagagem pra transformar o mundo. Apesar do conteúdo ser embasado em pesquisa, não se trata de um canal preparatório de conteúdo educacional, mas de informação e formação política com forte viés marxista.

